import React from "react";
import "./Checkout.css";
import banner from "../../assets/photos/skateboard1.png";
import { SubdirectoryArrowLeft } from "@material-ui/icons";

const Checkoout = () => {
  return (
    <div className="checkout">
      <img className="checkout__ad" src={banner} alt="" />
      <div className="checkout__container">
        <div className="checkout__left">
          <div>
            <h2 className="checkout__title checkout__title__left">Your Shopping Cart</h2>
          </div>
        </div>
        <div className="checkout__right">
          <div>
            <h4 className="checkout__title_right">Your Subtotoal is:</h4>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Checkoout;
